  \"2013-03-15T14:36:03.115878\",\n\t\"name\": \"democensus-blckgr2010\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"BLCKGR2010 contains a subset of attributes
  from Summary File 1 of the 2010 Decennial Census. The TIGER/Line Files are shapefiles
  and related database files (.dbf) that are an extract of selected geographic and
  cartographic information from the U.S. Census Bureau's Master Address File / Topologically
  Integrated Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB). The
  MTDB represents a seamless national file with no overlaps or gaps between parts,
  however, each TIGER/Line File is designed to stand alone as an independent data
  set, or they can be combined to cover the entire nation. States and equivalent entities
  are the primary governmental divisions of the United States. In addition to the
  fifty States, the Census Bureau treats the District of Columbia, Puerto Rico, and
  each of the Island Areas (American Samoa, the Commonwealth of the Northern Mariana
  Islands, Guam, and the U.S. Virgin Islands) as the statistical equivalents of States
  for the purpose of data presentation.\",\n\t\"license_title\": null,\n\t\"extras\":
